import web from '../src/images/menu-1.png';
import app from '../src/images/menu-2.png';
import android from '../src/images/menu-3.png';
import digital from '../src/images/menu-4.png';
import marketing from '../src/images/menu-5.png';
import software from '../src/images/menu-6.png';

const Sdata = [
    {
        
        imgsrc: web,
        title: "Web Development"
    },
    {
        
        imgsrc: app,
        title: "App Development"
    },
    {
        
        imgsrc: software,
        title: "software Development"
    },
    {
        
        imgsrc: digital,
        title: "Digital Marketing"
    },
    {
        
        imgsrc: android,
        title: "Android Development"
    },
    {
        
        imgsrc: marketing,
        title: "Marketing",
    }
]
export default Sdata;
